window.bookSummaryJSON = "<p>The Vampire War is over. The United States is reeling. The Masquerade is fragmenting. The Apocalypse is here.</p> <p>The long and bloody war with the vampires in the United States has finally ended, thanks to the efforts of the vampire Arbiter and ONSET Commander David White - and a nuclear explosion on American soil.</p> <p>The final battle proves harder to conceal than hoped, however, and a series of high profile incidents end any chance of hiding the supernatural. Suddenly, the world is faced with the fact that it is both more wonderful and more terrible than humanity ever realized.</p> <p>But as the US government struggles to adapt to this new reality, old enemies have set into motion plans that could render humanityâ€™s struggles irrelevant. There are those beyond the Seal who were once gods...and they want their planet back!</p>"; 
